import React, { Component } from "react";
import {
  CardElement,
  injectStripe,
  Elements,
  StripeProvider
} from "react-stripe-elements";
import {
  Button,
  Container,
  Divider,
  Form,
  Header,
  Item,
  Label,
  Message,
  Select
} from "semantic-ui-react";
import { Link, withRouter,NavLink } from "react-router-dom";
import { authAxios } from "../utils";
import {
  checkoutURL,
  orderSummaryURL,
  addCouponURL,
  addressListURL
} from "../constants";
import { endpoint } from "../constants";

class CheckoutForm extends Component {
  state = {
    data1: '',
    error: null,
    loading: false,

    formData: {
      shopping_fast_name: "",
      shopping_last_name: "",
      shopping_phone: "",
      shopping_zip_code: "",
      shopping_address: "",
      shopping_district: "",
      shopping_division: "",
      id: ""


    },
    saving: false,
    success: false


  };





  componentDidMount() {
    this.setState({ loading: true });
    authAxios
      .get(`${endpoint}/shippingaddresslistview/`)

      .then(res => {
        this.setState({ formData: res.data.results[0], loading: false });


      })
      .catch(err => {
        this.setState({ error: err, loading: false });
      });
  }





  render() {
    const {
      data,
      error,
      loading,
      formData

    } = this.state;
    console.log(formData,'formData')

    return (
      <div className='container'>
        <div className='row'>
        <div className ='col-md-6'>
        <h4> Shipping Address</h4>
            <p> <h4>{formData.shopping_fast_name} {formData.shopping_last_name}</h4>
              <p>{formData.shopping_address}</p>
              <p>{formData.shopping_district} {formData.shopping_division} {formData.shopping_zip_code}</p>
              <p>{formData.shopping_phone}</p>
            </p> 
        </div>











          <div className ='col-md-12'>
                    <Button
                      loading={loading}
                      disabled={loading}
                      primary
                      onClick={this.submit}
                      style={{ marginTop: "10px" }}
                    >
                      Submits
                  </Button>
          </div>
        </div>

      </div>
    );
  }
}

;

export default CheckoutForm;
